      SELECT col2 AS col2 FROM tab0 (FORMAT parquet) WHERE + + 2 + - ( + + col2 ) = ( + ( CAST ( + - col2 AS INTEGER ) ) + col0 + - ( + col0 ) );
  - name: tab0

outputs:
  - name: q9656.out
    data: |
